import {BrowserRouter, Route} from "react-router-dom";
import Index from "./Index/Index";

export default function App() {
  const router = createBrowserRouter([
    {
      path: "/",
      element: <Index />,
    },
  ]);

  return (
    <RouterProvider router={router}/>
  )
}
